import React, { useEffect, useState } from "react";
import "../../styles/WhyRGM.css";

/* HERO SLIDESHOW IMAGES (gallery10‚Äì17) */
const heroImages = [];
for (let i = 10; i <= 17; i++) {
  heroImages.push(require(`../../assets/gallery/images/gallery${i}.jpg`));
}

/* MAIN SLIDESHOW IMAGES (gallery18‚Äì25) */
const mainImages = [];
for (let i = 18; i <= 25; i++) {
  mainImages.push(require(`../../assets/gallery/images/gallery${i}.jpg`));
}

function WhyRGM() {
  const [heroIndex, setHeroIndex] = useState(0);
  const [mainIndex, setMainIndex] = useState(0);

  /* HERO SLIDESHOW */
  useEffect(() => {
    const interval = setInterval(() => {
      setHeroIndex((prev) => (prev + 1) % heroImages.length);
    }, 4500);
    return () => clearInterval(interval);
  }, []);

  /* MAIN SLIDESHOW */
  useEffect(() => {
    const interval = setInterval(() => {
      setMainIndex((prev) => (prev + 1) % mainImages.length);
    }, 4000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="why-rgm-page">

      {/* HERO */}
      <section
        className="why-hero"
        style={{ backgroundImage: `url(${heroImages[heroIndex]})` }}
      >
        <div className="hero-overlay">
          <h1>Why RGM Family</h1>
          <p>
            At RGM, you‚Äôre not just joining a company ‚Äî
            you‚Äôre becoming part of a family that grows together.
          </p>
        </div>
      </section>

      {/* INTRO */}
      <section className="why-intro">
        <p>
          RGM may be a young company, but our foundation is built on something
          timeless: <strong>trust, respect, and people-first values</strong>.
          We believe success comes from taking care of our drivers, employees,
          and partners like family ‚Äî because when they succeed, we succeed.
        </p>
      </section>

      {/* SLIDESHOW SECTION */}
      <section className="why-slideshow">
        <h2>Life at RGM</h2>
        <div className="slideshow-frame">
          <img
            src={mainImages[mainIndex]}
            alt="Life at RGM"
            key={mainIndex}
          />
        </div>
      </section>

      {/* VALUES */}
      <section className="why-values">

        <div className="value-card">
          <h3>ü§ù Family First Culture</h3>
          <p>
            We treat everyone with respect and fairness. At RGM,
            your voice matters, your concerns are heard, and your growth is
            important to us.
          </p>
        </div>

        <div className="value-card">
          <h3>üõ° Integrity & Trust</h3>
          <p>
            We do business the right way. Honesty, transparency, and ethical
            decision-making guide everything we do.
          </p>
        </div>

        <div className="value-card">
          <h3>üöõ Driver-Focused Mindset</h3>
          <p>
            Drivers are the backbone of RGM. We focus on clear communication,
            fair opportunities, and reliable support on and off the road.
          </p>
        </div>

        <div className="value-card">
          <h3>üìà Growth Together</h3>
          <p>
            As RGM grows, our people grow with us. We believe in long-term
            relationships, not short-term gains.
          </p>
        </div>

        <div className="value-card">
          <h3>üß† Smart Technology</h3>
          <p>
            We use modern tools and systems to make work easier, safer,
            and more efficient ‚Äî without losing the human touch.
          </p>
        </div>

        <div className="value-card">
          <h3>üíô Support Beyond Work</h3>
          <p>
            Life doesn‚Äôt stop at work ‚Äî and neither does our support.
            We care about your well-being, inside and outside the job.
          </p>
        </div>

      </section>

      {/* FAMILY MESSAGE */}
      <section className="family-message">
        <h2>This Is More Than a Job</h2>
        <p>
          When you join RGM, you‚Äôre joining a team that looks out for one another,
          celebrates wins together, and stands together through challenges.
          That‚Äôs what family means to us.
        </p>
      </section>

      {/* CTA */}
      <section className="why-cta">
        <h2>Let‚Äôs Talk About Your Future With RGM</h2>
        <button>Contact RGM Family</button>
      </section>

    </div>
  );
}

export default WhyRGM;
